import logo from './logo.svg';
import './App.css';
import Main from './pages/main';
import { Route, Router,Switch} from 'react-router-dom';
import Login from './pages/login';


function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/'><Main/></Route>
        <Route path='/login'><Login/></Route>

      </Switch>

    </Router>  

  );
}

export default App;
